import React from 'react';
import {Link} from 'react-router-dom';

function NotFound(){
    return(
        <>
       <h1>
            Sorry page not found!!!</h1>
            <Link to={`/`} className="btn btn-outline-dark mt-2" >Back</Link>
</>
    );

}

export default NotFound;
